using System;
using System.Web.Mvc;

namespace ExtratoPrevidencia.Controllers
{
    
    public class HomeController : Controller
    {        
        public ActionResult Index()
        {            
            return View();
        }

        [HttpGet]
        public void Gerar()        
        {
            var pdf = "";

            //pdf = "sdfsd";

            var base64String = pdf;

            string data = "2019";

            try
            {
                Response.AddHeader("Content-Type", "application/pdf");
                //Response.AddHeader("Content-Disposition", "inline;");
                Response.AppendHeader("content-disposition", "attachment; filename=ExtratoPrev" + data + ".pdf");
                Response.AddHeader("Cache-Control", "private, max-age=0, must-revalidate");
                Response.AddHeader("Pragma", "public");
                Response.BinaryWrite(Convert.FromBase64String(base64String));
            }
            catch (Exception e)
            {
                ViewBag.Error = "No foi possvel gerar o arquivo PDF.";
            }
            
        }

        [HttpPost]
        public void Gerar1(string ano, string mes)
        {
            var pdf = "";

            //pdf = "sdfsd";

